import React from 'react'
import ReactDOM from 'react-dom'
import { Button } from 'bold-ui'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <body className="App-body"></body>  
    </div>
  );
}

export default App;
